export default function Resume() {
  return (
    <footer>
      <div className="footer-content">
        <p style={{ paddingTop: "15px" }}>Build + include links to social profiles: Twitter, YouTube, Technical Blog, LinkedIn, GitHub & Acknowledgements.</p>
        <p style={{ paddingTop: "15px" }}>Footer should be a solid color and fixed at the bottom of the screen.</p>
        <div style={{ paddingTop: "15px" }}>
          <HashLink className="link" smooth to="/#home">Top Of Page</HashLink>
        </div>
      </div>
    </footer>
  );
}
